import './App.css';
import Header from './Header';
import Card from './Card';
import Guessing from './Guessing';
import Counter from './Counter';
import Button from './Button';

function App() {
  return (
    <>
      <Header />
      <Button color='green' text='Start' />
      <Guessing />
      <Counter />
    </>
  )
}

export default App;
